import React, { useState } from 'react';

const SimDeactivationForm = () => {
  const [simInfo, setSimInfo] = useState({
    s_sim_no: '',
    sim_dlt_dt: null,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSimInfo((prevData) => ({ ...prevData, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Sim Deactivation Form Submitted:', simInfo);
  };

  return (
    <div className="sim-deactivation-form">
      <h2>SIM Deactivation Form</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="s_sim_no">SIM No.:</label>
          <input
            type="number"
            id="s_sim_no"
            name="s_sim_no"
            value={simInfo.s_sim_no}
            onChange={handleChange}
          />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default SimDeactivationForm;
